import React from 'react';
import styles from './Modal.module.css';

const Modal = (props) => {
  return (
    <>
      <div
        className={styles.backdrop}
        onClick={props.removeModalHandler || props.onRemoveInstructionsModal}
      ></div>
      <footer>
        <button
          className={styles.button}
          onClick={props.removeModalHandler || props.onRemoveInstructionsModal}
        >
          Okay
        </button>
      </footer>
    </>
  );
};

export default Modal;
